""" A parser for the output of a MultiHaul TG 'show' """

import ipaddress
from lxml import etree
import re

from tgtools.consts import RE_SW_VER
from tgtools.utils.errlog import Err
from tgtools.utils.miscfuncs import add_commas_thousands, prettyprint_etree


def _concat_sectors(bitmap: int) -> str:
    """
    Convert a 4-bit bit map 'bitmap' to a contatenated string of corresponding sector numbers.
    E.g.: bitmap = 5 = 0b0101 -> '13' (sectors 1 and 3)
    """
    assert 0 < bitmap < 16
    sectors: str = ""
    for sector in ('1', '2', '3', '4'):
        if bitmap & 1:
            sectors += sector
        bitmap >>= 1
    return sectors


class TgParser:
    """ A parser for the XML response of the 'get' RPC (or any valid XML part thereof).
        The XML string is converted to an `lxml.etree <https://lxml.de/tutorial.html>`_, which is then parsed
        by the following high-level sections: *interfaces*, *inventory*, *ipv4*,
        *common_node*, *common_sectors*, *common_links*, *dn_node*, *dn_sectors*, *dn_links*,
        *system*, *user_bridge*.

        Each high-level section is tokenised into a list of dictionaries, where the keys of each
        dictionary comprise some fixed prefix data_tokens, and the more informative data_tokens (specific
        for each section). The values corresponding to each key (token) is derived from the input XML.
        The list for each section is pointed-to by the mapping :attr:`TgParser.parsed`.
        The data_tokens (keys for each dictionary) are pointed to by the mapping :attr:`TgParser.data_tokens`. For example:

         * `TgParser.parsed['interfaces']` is a list of dictionaries, each describing one of the individual
           interface under this section, using certain data_tokens and their respective values.
         * `TgParser.data_tokens['interfaces']` is a list of these data_tokens.

        Some high-level sections are combined to offer a more concise view:
         * *radio-dn/node* and *radio-common/node* are combined in section **node**,
         * *radio-dn/sectors* and *radio-common/sectors* are combined in section **sectors**,
         * *radio-dn/links* and *radio-common/links* are combined in section **links**.
    """

    def __init__(self, xml: str, prefix_tokens: dict[str, str] = None):
        """

        :param xml: an XML string to be parsed.
        :type xml: str
        :param prefix_tokens: an optional dictionary with fixed data_tokens that are prefixed for all
            output dictionaries. Typical keys are 'route' (denoting how a radio was accessed),
            and 'timestamp' (the time at which the XML was obtained from the radio).
        :type prefix_tokens: dict[str, str]
        """

        #: The XML input (argument specified when instantiating this class).
        self.xml: str = xml
        if prefix_tokens:
            self._base_dict = prefix_tokens.copy()
        else:
            self._base_dict = {}
        #: A list of error messages, each represented as :class:`tg.utils.errlog.Err`.
        self.errors: list[Err] = []

        # Convert XML string to etree
        #: The `lxml.etree <https://lxml.de/tutorial.html>`_ representation of :attr:`xml`
        self.xml_etree: etree.Element
        try:
            self.xml_etree = etree.fromstring(xml.encode('utf-8'))
        except etree.LxmlSyntaxError as e:
            error = Err(f"{self.__class__.__qualname__}()",f"lxml.etree: {e}\n{xml}")
            self.errors.append(error)
            self.xml_etree = etree.fromstring('<None/>')
        # The high-level sections on the basis of which :attr:`xml` is parsed.
        self.sections = [
            'interfaces',
            'inventory',
            'ipv4',
            '_common_node',
            '_common_sectors',
            '_common_links',
            '_dn_node',
            '_dn_sectors',
            '_dn_links',
            'system',
            'user_bridge',
            'node',
            'sectors',
            'links',
        ]

        #: The main output of this class: a mapping from each section name to a list of dictionaries,
        #: where each dictionary comprises some data_tokens.
        self.parsed: dict[str, list] = {section: [] for section in self.sections}
        #: A mapping from each section name to a list of its respective data_tokens.
        self.tokens: dict[str, list] = {section: [] for section in self.sections}
        self.tokenise()
        #: The name of the radio (as derived from the *system* section)
        self.local: str
        if len(self.parsed['system']) > 0:
            self.local = self.parsed['system'][0].get('name', '')
        else:
            self.local = ''
        #: A list of all connected remote CNs (as derived from the *radio-dn/links* section).
        self.remote_cns: list[str] = [link['remote'] for link in self.parsed['_dn_links']
                                      if link['type'] == 'cn' and link['state'] == 'Connected']
        #: Post-processing


    def __repr__(self):
        N = 20  # max number of chars to print out in first argument (xml)
        if len(self.xml) > N:
            trunc_get_xml = self.xml[:N] + '...'
        else:
            trunc_get_xml = self.xml
        return f"{self.__class__.__name__}('{trunc_get_xml}', {self._base_dict})"

    def __str__(self):
        string = f"{self.__class__.__name__}:\n"
        string += f"\tLocal name: {self.local}\n"
        string += f"\tRemote CNs: {self.remote_cns}\n"
        for section in self.sections:
            string += f"\tParsed {section}:\n"
            for record in self.parsed[section]:
                string += f"\t\t{record}\n"
        string += f"\tErrors:\n"
        for error in self.errors:
            string += f"\t\t{error}\n"
        return string

    def tokenise(self):
        """ Executes all the different *tokenise_...* methods corresponding to each high-level section.
            Then use :meth:`TgParser.combine_tokens` to combine some sections together for a more comprehensive view.
        """
        _ = self.tokenise_interfaces()
        _ = self.tokenise_inventory()
        _ = self.tokenise_ipv4()
        _ = self.tokenise_common_node()
        _ = self.tokenise_common_sectors()
        _ = self.tokenise_common_links()
        _ = self.tokenise_dn_node()
        _ = self.tokenise_dn_sectors()
        _ = self.tokenise_dn_links()
        _ = self.tokenise_user_bridge()
        _ = self.tokenise_system()
        _ = self.combine_tokens('node', '_dn_node', '_common_node')
        _ = self.combine_tokens('sectors', '_dn_sectors', '_common_sectors', token='sector')
        _ = self.combine_tokens('links', '_dn_links', '_common_links', token='remote')
        return None

    def tokenise_interfaces(self) -> list[dict]:
        """ Tokenise the **interface** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = 'interfaces'
        root = self.xml_etree.find('.//{*}interfaces')
        tokens = dict(
            ifDescr='{*}ifDescr',
            iftype='{*}iftype',
            ifMtu='{*}ifMtu',
            ifSpeed='{*}ifSpeed',
            mac_address='{*}mac-address',
            admin_status='{*}admin-status',
            oper_status='{*}oper-status',
            auto_negotiation='{*}copper-specific-config/{*}auto-negotiate',
            pse_out='{*}copper-specific-config/{*}pse-out',
            physical_connector_type='{*}physical-connector-type',
            port_speed='{*}port-speed',
            actual_duplex_mode='{*}actual-duplex-mode',
            actual_port_speed='{*}actual-port-speed',
            interface_type='{*}interface-type',
            name='{*}name',
            in_octets='{*}in-octets',
            in_pkts='{*}in-pkts',
            in_discards='{*}in-discards',
            in_errors='{*}in-errors',
            in_no_rule_discards='{*}in-no-rule-discards',
            out_octets='{*}out-octets',
            out_pkts='{*}out-pkts',
            out_discards='{*}out-discards',
            ifLinkUpDownTrapEnable='{*}ifLinkUpDownTrapEnable',
            out_errors='{*}out-errors',
            ifHighSpeed='{*}ifHighSpeed',
            ifPromiscuousMode='{*}ifPromiscuousMode',
            ifConnectorPresent='{*}ifConnectorPresent',
            alias='{*}alias',
            ifCounterDiscontinuityTime='{*}ifCounterDiscontinuityTime',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            for element in root.iterfind('{*}interface'):
                record = self._base_dict.copy()
                record.update({key: element.findtext(value, default='') for key, value in tokens.items()})
                for key in ['ifSpeed', 'in_octets', 'in_pkts', 'in_discards', 'in_errors', 'in_no_rule_discards',
                            'out_octets', 'out_pkts', 'out_discards']:
                    record[key] = add_commas_thousands(record[key])
                records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_inventory(self) -> list[dict]:
        """ Tokenise the **inventory** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = 'inventory'
        root = self.xml_etree.find('.//{*}inventory')
        tokens = dict(
            name='{*}name',
            description='{*}description',
            hardware_rev='{*}hardware-rev',
            firmware_rev='{*}firmware-rev',
            software_rev='{*}software-rev',
            serial_num='{*}serial-num',
            mfg_name='{*}mfg-name',
            model_name='{*}model-name',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            for element in root.iterfind('{*}component'):
                fru = element.findtext('{*}is-fru', default='')
                if fru == 'false':
                    continue
                record = self._base_dict.copy()
                record.update({key: element.findtext(value, default='') for key, value in tokens.items()})
                records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_ipv4(self) -> list[dict]:
        """ Tokenise the **ip/ipv4** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = 'ipv4'
        root = self.xml_etree.find('.//{*}ipv4')
        tokens = dict(
            ip_addr='{*}ip',
            prefix_len='{*}prefix-length',
            c_vlan='{*}c-vlan',
            default_gateway='{*}default-gateway',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            for element in root.iterfind('{*}address'):
                record = self._base_dict.copy()
                record.update({key: element.findtext(value, default='') for key, value in tokens.items()})
                records.append(record)
            gateway = root.findtext('{*}default-gateway')
            if gateway:
                gateway_ip = ipaddress.IPv4Address(gateway)
                for record in records:
                    network = ipaddress.IPv4Network(f"{record['ip_addr']}/{record['prefix_len']}", strict=False)
                    if gateway_ip in network:
                        record['default_gateway'] = gateway
                        break
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_common_node(self) -> list[dict]:
        """ Tokenise the **radio_common/node-config** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = '_common_node'
        root = self.xml_etree.find('.//{*}radio-common/{*}node-config')
        tokens = dict(
            ssid='{*}default-ssid-profile/{*}ssid',
            password='{*}default-ssid-profile/{*}password',
            op_mode='{*}operation-mode',
            dist='{*}link-distance',
            tx_power='{*}tx-power-control',
            dn_link_monitor='{*}dn-link-monitor-timeout',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            record = self._base_dict.copy()
            record.update({key: root.findtext(value, default='') for key, value in tokens.items()})
            records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_common_sectors(self) -> list[dict]:
        """ Tokenise the **radio_common/sectors-config** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """

        section = '_common_sectors'
        root = self.xml_etree.find('.//{*}radio-common/{*}sectors-config')
        tokens = dict(
            sector='{*}index',
            admin_status='{*}admin-status',
            dn_link_monitor='{*}dn-link-monitor/{*}enabled',
            act_freq='{*}state/{*}frequency',
            antenna='{*}state/{*}antenna-mode',
            sync_mode='{*}state/{*}sync-mode',
            temp_modem='{*}state/{*}temperatures/{*}modem-temperature',
            rf1_temp='place_keeper',
            rf2_temp='place_keeper',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            for element in root.iterfind('{*}sector'):
                record = self._base_dict.copy()
                record.update({key: element.findtext(value, default='') for key, value in tokens.items()})
                for rf in root.iterfind('.//{*}rf'):
                    index = rf.findtext('{*}index')
                    temp = rf.findtext('{*}rf-temperature')
                    if index == '1':
                        record['rf1_temp'] = temp
                    else:
                        record['rf2_temp'] = temp
                records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_common_links(self) -> list[dict]:
        """ Tokenise the **radio_common/links** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = '_common_links'
        root = self.xml_etree.find('.//{*}radio-common/{*}links')
        tokens = dict(
            remote='{*}remote-assigned-name',
            role='{*}local-role',
            uptime_link='{*}link-uptime-string',
            uptime_local='place_keeper',
            uptime_remote='place_keeper',
            act_lsec='{*}actual-local-sector-index',
            act_rsec='{*}actual-remote-sector-index',
            tx_power_index='{*}tx-power-index',
            rssi='{*}rssi',
            snr='{*}snr',
            mcs_tx='{*}mcs-tx',
            mcs_rx='{*}mcs-rx',
            tx_per='{*}tx-per',
            rx_per='{*}rx-per',
            antenna='place_keeper',
            tiles_tx='{*}active-tile-count-tx',
            tiles_rx='{*}active-tile-count-rx',
            bm_ind_tx='{*}beam-index-tx',
            bm_az_tx='{*}beam-azimuth-tx',
            bm_el_tx='{*}beam-elevation-tx',
            bm_ind_rx='{*}beam-index-rx',
            bm_az_rx='{*}beam-azimuth-rx',
            bm_el_rx='{*}beam-elevation-rx',
            tx_ok='{*}tx-ok',
            tx_fail='{*}tx-fail',
            tx_exp='{*}tx-failures',
            rx_ok='{*}rx-ok',
            rx_fail='{*}rx-fail',
            rx_hcs='{*}rx-hcs-fail',
            rx_expire='{*}rx-failures',
            rx_buf='{*}rx-drop-buf-size',
            rx_enc='{*}rx-drop-encryption-fail',
            rx_ra_mis='{*}rx-drop-ra-mismatch',
            rx_other='{*}rx-drop-unexpected',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            for element in root.iterfind('{*}active'):
                record = self._base_dict.copy()
                record.update({key: element.findtext(value, default='') for key, value in tokens.items()})
                # truncate role to 4 chars
                record['role'] = record['role'][0:min(4, len(record['role']))]
                # add comma separators for potentially long numbers
                for key in ['tx_ok', 'tx_fail', 'tx_exp',
                            'rx_ok', 'rx_fail', 'rx_hcs', 'rx_expire', 'rx_buf', 'rx_enc', 'rx_ra_mis', 'rx_other']:
                    record[key] = add_commas_thousands(record[key])
                records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_dn_node(self) -> list[dict]:
        """ Tokenise the **radio_dn/node-config** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = '_dn_node'
        root = self.xml_etree.find('.//{*}radio-dn/{*}node-config')
        tokens = dict(
            product='place_keeper',
            freq='{*}default-radio-profile/{*}frequency',
            polarity='{*}default-radio-profile/{*}polarity',
            tx_golay='{*}default-radio-profile/{*}tx-golay-index',
            rx_golay='{*}default-radio-profile/{*}rx-golay-index',
            pop_dn='{*}is-pop-dn',
            sync_mode='{*}sync-mode',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            record = self._base_dict.copy()
            record.update({key: root.findtext(value, default='') for key, value in tokens.items()})
            for key in ['freq', 'polarity', 'tx_golay', 'rx_golay']:
                if record[key] == 'unspecified':
                    record[key] = 'unspec'
            records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_dn_sectors(self) -> list[dict]:
        """ Tokenise the **radio_dn/sectors-config** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """

        section = '_dn_sectors'
        root = self.xml_etree.find('.//{*}radio-dn/{*}sectors-config')
        tokens = dict(
            product='place_keeper',
            sector='{*}index',
            cfg_freq='{*}radio-profile/{*}frequency',
            polarity='{*}radio-profile/{*}polarity',
            tx_golay='{*}radio-profile/{*}tx-golay-index',
            rx_golay='{*}radio-profile/{*}rx-golay-index',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            for element in root.iterfind('{*}sector'):
                record = self._base_dict.copy()
                record.update({key: element.findtext(value, default='') for key, value in tokens.items()})
                for key in ['cfg_freq', 'polarity', 'tx_golay', 'rx_golay']:
                    if record[key] == 'unspecified':
                        record[key] = 'unspec'
                records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_dn_links(self) -> list[dict]:
        """ Tokenise the **radio_dn/links/configured** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = '_dn_links'
        root = self.xml_etree.find('.//{*}radio-dn/{*}links')
        tokens = dict(
            remote='{*}remote-assigned-name',
            cfg_lsec='place_keeper',
            cfg_rsec='place_keeper',
            type='{*}responder-node-type',
            admin='{*}admin-status',
            state='{*}dn-link-state',
            tx_golay='{*}tx-golay-index',
            rx_golay='{*}rx-golay-index',
            down_cause='.//{*}down-cause',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            for element in root.iterfind('{*}configured'):
                record = self._base_dict.copy()
                record.update({key: element.findtext(value, default='') for key, value in tokens.items()})
                # If responder-node-type is dn, add control-superframe
                if record['type'] == 'dn':
                    superframe = element.findtext('{*}control-superframe')
                    record['type'] = f"dn{superframe}"
                # Concatenate sectors
                sector_bitmap = int(element.findtext('{*}local-sector-bitmap'))
                if sector_bitmap == 0:
                    sector_bitmap = 1
                record['cfg_lsec'] = _concat_sectors(sector_bitmap)
                sector_bitmap = int(element.findtext('{*}remote-sector-bitmap'))
                if sector_bitmap == 0:
                    sector_bitmap = 1
                record['cfg_rsec'] = _concat_sectors(sector_bitmap)
                # Shorten 'unspecified' to 'unspec'
                for token in ['tx_golay', 'rx_golay']:
                    if record[token] == 'unspecified':
                        record[token] = 'unspec'
                records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_system(self) -> list[dict]:
        """ Tokenise the **system** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = 'system'
        root = self.xml_etree.find(f'.//{{*}}{section}')
        tokens = dict(
            name='{*}name',
            product='{*}state/{*}product',
            tod='{*}state/{*}date-and-time',
            uptime='{*}state/{*}uptime',
            sw_active='place_keeper',
            sw_passive='place_keeper',
            gps_fix_mode='{*}state/{*}gps/{*}fix-mode',
            gps_nsats='{*}state/{*}gps/{*}fix-satellites-number',
            contact='{*}contact',
            loc='{*}location',
            gps_lat='{*}state/{*}gps/{*}latitude',
            gps_long='{*}state/{*}gps/{*}longitude',
            gps_height='{*}state/{*}gps/{*}height-sea-level',
            gps_time='{*}state/{*}gps/{*}time',
        )
        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens.keys()})
        records: list[dict] = []
        if root is not None:
            record = self._base_dict.copy()
            record.update({key: root.findtext(value, default='') for key, value in tokens.items()})
            for bank in root.iterfind('.//{*}banks'):
                status = bank.findtext('{*}status', default='')
                if m := re.match(RE_SW_VER, bank.findtext('{*}software-version', default='')):
                    sw_version = m[1]
                else:
                    sw_version = 'unknown'
                match status:
                    case 'active':
                        record['sw_active'] = sw_version
                    case 'passive':
                        record['sw_passive'] = sw_version
                    case _:
                        pass
            records.append(record)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def tokenise_user_bridge(self) -> list[dict]:
        """ Tokenise the **radio_common/links** section of the input XML.

        Updates :attr:`TgParser.parsed` and :attr:`TgParser.data_tokens`.

        :return: List of dictionaries, each representing (in data_tokens) elements of this section.
        :rtype: list[dict]
        """
        section = 'user_bridge'
        root = self.xml_etree.find('.//{*}user-bridge')
        tokens1 = dict(
            bridge_id='{*}bridge-id',
        )
        tokens2 = dict(
            port_id='{*}bridge-port-id',
            interface='{*}interface',
            type='{*}bridge-port-type',
            cvlan='{*}c-vlan',
            svlan='{*}s-vlan',
        )

        record: dict = self._base_dict.copy()
        record.update({key: '' for key in tokens1.keys()})
        record.update({key: '' for key in tokens2.keys()})
        records: list[dict] = []
        if root is not None:
            for element in root.iterfind('{*}bridge'):
                record = self._base_dict.copy()
                record.update({key: element.findtext(value, default='') for key, value in tokens1.items()})

                for port in element.iterfind('{*}bridge-port'):
                    bridge_port = record.copy()
                    bridge_port.update({key: port.findtext(value, default='') for key, value in tokens2.items()})
                    if bridge_port['type'] == 'transparent':
                        bridge_port['type'] = 'transp'
                    records.append(bridge_port)
        self.parsed[section] = records
        self.tokens[section] = list(record.keys())
        return self.parsed[section]

    def combine_tokens(self, section_out: str, section_in1: str, section_in2: str, token: str = '') -> list[dict]:
        """ Combines data_tokens of two different sections. If `token` is provided, then elements from
        the two sections are matched based on the value of that token.
        Otherwise, matching is in order (i-th element in `section_in1` combined with i-th element in `section_in2`).

        :param section_out: Name of the new output (combined) section.
        :type section_out: str
        :param section_in1: Name of the first section (of the two) to combine.
        :type section_out: str
        :param section_in2: Name of the second section (of the two) to combine.
        :type section_out: str
        :param token: an optional token for pair-matching elements from `section_in1` and `section_in2`.
        :type section_out: str
        :return: List of dictionaries, each dictionary includes data_tokens combined from both `section_in1` and `section_in2`.
        :rtype: list[dict]
        """
        assert section_in1 in self.sections
        assert section_in2 in self.sections
        list1 = self.parsed[section_in1]
        list2 = self.parsed[section_in2]
        combined_keys = self.tokens[section_in1] + self.tokens[section_in2]
        record_template = dict.fromkeys(combined_keys, '')
        records = []
        processed = []
        if token:
            for item1 in list1:
                record = record_template.copy()
                record.update(item1)
                processed.append(item1[token])
                for item2 in list2:
                    if item2[token] == item1[token]:
                        record.update(item2)
                        break
                records.append(record)
            # Deal with remainders in list2 (those not already processed)
            for item2 in list2:
                if item2[token] not in processed:
                    record = record_template.copy()
                    record.update(item2)
                    records.append(record)
        else:
            for i in range(min(len(list1), len(list2))):
                record = record_template.copy()
                record.update(list1[i])
                record.update(list2[i])
                records.append(record)
            # Save results
        self.parsed[section_out] = records
        self.tokens[section_out] = list(record_template.keys())
        return self.parsed[section_out]



